problem_content_answer_ess_02:
Motiv posibil 
 1. Șirul fotovoltaic scurtcircuitează împământarea de protecție; 
 2. Mediul de instalare a șirurilor fotovoltaice este relativ umed; 
 3. Portul bateriei este scurtcircuitat la împământarea de protecție; 
 Cum se procedează în caz de 
 1. Reporniți dispozitivul; dacă defecțiunea dispare, îl puteți utiliza în continuare; 
 2. Dacă defecțiunea apare sau nu dispare de mai multe ori la rând, vă rugăm să contactați furnizorul de servicii;

